import React from 'react';
import './style.css';


class Search extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      inputValue: ''
    }
  }

  handleChange(e) {
    console.log(e.target.value)
  }
  render() {
    return (
      <div className="search">
        <input onChange={(e) => this.handleChange(e)} class="inputSearch" type="text" placeholder="Buscar..."></input>
      </div>
    );
  }
}

export default Search;
